import React from 'react';
import styles from './index.css';

class Menu extends React.Component
{
	render ()
	{
		return (
				<div>
        			<div className="nav_left">
          				<p>Пополнить</p>
          				<p>Вывести</p>
          				<p>Операции</p>
          				<p>Сделки</p>
          				<p>Профиль</p>
          				<p>Котировки</p>
        			</div>
        		<div className="nav_right">
        			<p>Счет №: 31998640USD</p>
        		</div>
      		</div>
		)
	}
}
export default Menu;
